	Year 2 of project:&amp;nbsp;&lt;/p&gt;
&lt;p&gt;
	The project continues the development of a microgravity-compatible BRIC evaporation chamber.&lt;br /&gt;
	The current BRIC system is a low-fidelity system/component breadboard used to demonstrate the basic functionality of an &amp;quot;in-place&amp;quot; brine drying process.&amp;nbsp; Under the current BRIC IR&amp;amp;D project, significant progress has been made in the development of a microgravity-compatible BRIC evaporator design.&amp;nbsp; These advancements include a number of potential BRIC evaporator design concepts employing novel static phase separation approaches based on capillary and surface tension phenomenon.&amp;nbsp; These design concepts have been furthered through the design and development of sub-scale test articles and methods for testing these systems under conditions of microgravity.&amp;nbsp; Data collected through this test program has highlighted the need to further refine the design and validate the performance of a BRIC system for brine dewatering applications in microgravity.&lt;/p&gt;
&lt;p&gt;
	Year 1 of project:&lt;/p&gt;
&lt;p&gt;
	Data describing the physical properties and drying behavior of brines, including vapor pressure equilibria, emissivity, specific heat, surface tension, and cohesion/adhesion and tack were determined as a function of the brine drying process.&amp;nbsp; Brine is generated using a rotary evaporator (Buchi, model K100) from human donated urine, augmented to match characteristics of urine produced on the International Space Station (ISS).&amp;nbsp; Brine solids were produced using the pre-prototype BRIC system.&amp;nbsp; In addition, sampling of the gas effluent of the system was conducted in partnership with the Space and Life Sciences Toxicology Laboratory to address concerns regarding hazardous gases that may evolve during the drying of brine solutions.&amp;nbsp;&lt;/p&gt;
